import React from "react";

const Genres = () => {
  console.log(genres);
  return (
    <ul class="list-group">
      <li class="list-group-item">All Genres</li>
      {genres.map((genre) => (
        <li class="list-group-item">{genre.name}</li>
      ))}
    </ul>
  );
};

export default Genres;
